(ns day5
  (:require [clojure.string :as str])
  (:require [clojure.instant :as instant]))

(def items (str/split
             (slurp "./src/day5.txt") #""))
(def alphabet (map char (range 97 123)))

(def test-string (str/split "dabAcCaCBAcCcaDA" #""))
(range)
(str/replace (str/join test-string) #"[Aa]" "")

(def filters (map (fn [x] (re-pattern (str "[" x (str/upper-case x) "]"))) alphabet))

(def joined-items (str/join items))

(def filtered-items (map (fn [x] (str/replace joined-items x "")) filters))
(def vec-filtered-items (vec filtered-items))

(defn remove-same-char [s-vec]
  (reduce (fn [acc v]
            (let [f (first v)
                  s (second v)
                  ]
              (if (and (= (str/lower-case f) (str/lower-case s)) (not (= f s)))
                (conj acc [])
                (conj acc [f s])
                )
              )
            )
          () (partition 2 2 ["0"] s-vec)))
(defn filter-left-array
  [v]
  (filter (fn [x] (< 0 (count x))) (remove-same-char v)))
(defn make-normal
  [x]
  (vec (flatten (reverse (filter-left-array x)))))


(make-normal test-string)

(defn insert-dummy [x] (conj (flatten (reverse (filter-left-array x))) "0"))

(defn go [x] (str/replace (str/join (make-normal (insert-dummy x))) "0" ""))

